High_Static_Pressure_Cutout_Setpoint_Limit:
  brick_parent: Static_Pressure_Setpoint_Limit
  brick_definition: A parameter that places a lower or upper bound on the range of
    permitted values of a High_Static_Pressure_Cutout_Setpoint.
Max_Static_Pressure_Setpoint_Limit:
  brick_parent: Static_Pressure_Setpoint_Limit
  brick_definition: A parameter that places an upper bound on the range of permitted
    values of a Static_Pressure_Setpoint.
Min_Static_Pressure_Setpoint_Limit:
  brick_parent: Static_Pressure_Setpoint_Limit
  brick_definition: A parameter that places a lower bound on the range of permitted
    values of a Static_Pressure_Setpoint.
